description:
Contains 4 studio albums by the Iron City Houserockers over the period of 1979-1984, as well as a &quot;Best Of&quot; compilation released by Rhino Records in 1992.

Love's So Tough (1979). Self ripped from CD, LAME 3.97 -V 0 average bitrate 242kbps.

Have a Good Time but Get out Alive! (1980). Self ripped from CD, LAME 3.97 -V 0 average bitrate 238kbps.

Blood On The Bricks (1981). Third party rip from vinyl, LAME 3.93 average bitrate 210kbps.

Cracking Under Pressure (1983). Digital download from Joe Grushecky's website. FhG average bitrate 123kbps.

Pumping Iron &amp; Sweating Steel (1992) The Best of the Iron City Houserockers. Self ripped from CD, LAME 3.97 -V 0 average bitrate 230kbps.

All albums have been tagged, MP3 GAINed, and optimized with MP3packer.
